import{_ as p,c as e,o as r,a as t}from"./app.57528e04.js";const f='{"title":"\u7C73\u8ECD\u30AD\u30E3\u30F3\u30D7","description":"","frontmatter":{},"relativePath":"Album/3-Through-the-Broken-Door/\u7C73\u8ECD\u30AD\u30E3\u30F3\u30D7.md","lastUpdated":1636294389672}',a={},o=t('<h1 id="\u7C73\u8ECD\u30AD\u30E3\u30F3\u30D7" tabindex="-1">\u7C73\u8ECD\u30AD\u30E3\u30F3\u30D7 <a class="header-anchor" href="#\u7C73\u8ECD\u30AD\u30E3\u30F3\u30D7" aria-hidden="true">#</a></h1><p>\u4E2D\u8B6F: \u7F8E\u8ECD\u99D0\u5730</p><p>\u4F5C\u8A5E\u30FB\u4F5C\u66F2: \u5C3E\u5D0E\u8C4A</p><p>\u7DE8\u66F2: \u897F\u672C\u660E</p><hr><p>\u6211\u7368\u500B\u6F2B\u7121\u76EE\u7684\u5730\u5728\u8857\u4E0A\u8D70\u8457</p><p>\u5E97\u8216\u95DC\u9580\u4E86 \u540C\u4F34\u4E5F\u4E0D\u5728\u4E86 \u5728\u4E1F\u6EFF\u7159\u982D\u7684\u8DEF\u4E0A</p><p>\u9023\u8857\u982D\u7684\u4E9B\u5FAE\u566A\u97F3\u4E5F\u4EE4\u6211\u7684\u5FC3\u986B\u6296\u7684\u591C\u88E1</p><p>\u6211\u521D\u6B21\u5728\u59B3\u61F7\u88E1\u5165\u7761</p><br><p>\u59B3\u512A\u96C5\u5730\u4E0D\u82DF\u8A00\u7B11</p><p>\u5728\u4EBA\u7FA4\u4E2D\u59B3\u4E0D\u767C\u4E00\u8A00</p><p>\u5728\u4E92\u76F8\u9700\u8981\u7684\u591C\u88E1 \u6211\u5011\u70BA\u4E86\u64AB\u6170\u5275\u50B7\u800C\u5728\u5C0B\u6C42\u611B</p><p>\u6211\u5011\u4E8C\u4EBA\u5305\u88F9\u8457\u6BDB\u5DFE\u5165\u7761</p><br><p>\u59B3\u5728\u591C\u5E02\u7684\u5C0F\u5E97\u5DE5\u4F5C</p><p>\u6211\u5728\u7B49\u5F85\u8457\u65E9\u4E0A\u4F86\u81E8</p><p>\u7B49\u5F85\u59B3\u5F9E\u9713\u8679\u71C8\u4E2D\u89E3\u653E\u51FA\u4F86</p><br><p>Oh \u59B3\u5728\u8A5B\u5492\u9019\u500B\u57CE\u5E02</p><p>\u59B3\u9811\u56FA\u5730\u9738\u4F54\u6240\u6709\u5922 \u6B63\u5728\u5FAC\u5FA8\u5730\u6D41\u6D6A\u5427</p><p>Oh \u5728\u9019\u6A23\u7684\u591C\u88E1 \u6211\u60F3\u64C1\u62B1</p><p>\u6211\u5728\u6C92\u6709\u56DE\u5831\u7684\u611B\u4E2D\u5931\u53BB\u7684\u59B3</p><br><p>\u6628\u665A\u59B3\u5728\u5BA2\u4EBA\u7684\u592E\u6C42\u4E0B\u53BB\u4E86\u6D77\u908A</p><p>\u59B3\u7B11\u8AAA\u59B3\u548C\u4ED6\u8001\u662F\u5728\u5435\u67B6 \u5F88\u662F\u7121\u804A</p><p>\u5728\u59B3\u89AA\u53E3\u8AAA\u51FA\u90A3\u500B\u964C\u751F\u7537\u4EBA\u7684\u540D\u5B57\u7684\u591C\u88E1</p><p>\u90A3\u500B\u4EE4\u59B3\u61F7\u5B55\u7684\u7537\u4EBA\u7684\u6212\u6307\u5728\u59B3\u7684\u6DDA\u4E2D\u767C\u5149</p><br><p>\u5728\u7F8E\u8ECD\u99D0\u5730\u907A\u5740\u90A3\u7834\u721B\u7684\u5DE5\u5834\u88E1</p><p>\u6211\u5011\u5728\u51B0\u51B7\u7684\u9ED1\u6697\u4E2D\u878D\u5316 \u5728\u9707\u76EA\u7684\u8ECA\u4E2D</p><p>\u6211\u7121\u529B\u5730\u4F38\u51FA\u5169\u624B\u53BB\u64C1\u62B1\u59B3 \u7576\u6211\u8F15\u64AB\u59B3\u7684\u982D\u9AEE\u6642</p><p>\u59B3\u8F15\u8072\u4F4E\u8A9E\u53EB\u6211\u4E0D\u8981\u653E\u624B \u4E26\u62B1\u4F4F\u4E86\u6211</p><br><p>\u6709\u4E9B\u6642\u5019 \u6211\u5006\u7684\u751F\u6D3B\u5728\u5B55\u80B2\u8457\u5922\u60F3</p><p>\u76F4\u5230\u6211\u5011\u767C\u73FE\u67D0\u4E9B\u6771\u897F</p><p>\u5728\u6495\u7834\u91CD\u8981\u7684\u6771\u897F</p><p>Oh \u59B3\u5728\u8A5B\u5492\u9019\u500B\u793E\u6703</p><p>\u59B3\u9811\u56FA\u5730\u9738\u4F54\u6240\u6709\u5922 \u6B63\u5728\u5FAC\u5FA8\u5730\u6D41\u6D6A\u5427</p><p>Oh \u5728\u9019\u591C\u88E1 \u6211\u60F3\u64C1\u62B1</p><p>\u6211\u5728\u6C92\u6709\u56DE\u5831\u7684\u611B\u4E2D\u5931\u53BB\u7684\u59B3</p><hr><p>\u8F49\u8F09\u81EA:</p><ul><li><a href="https://web.archive.org/web/20110430114450/http://blog.yam.com/rss.php?blog_id=forgetnot&amp;catid=711255" target="_blank" rel="noopener noreferrer">Wayback Machine</a></li></ul>',44),_=[o];function n(c,h,s,i,d,l){return r(),e("div",null,_)}var m=p(a,[["render",n]]);export{f as __pageData,m as default};
